import React, { useContext } from 'react';
import { AuthContext } from '../context/authContext';
import { Button } from "@/components/ui/button"
import Logo from './logo';
import './PanelDeControl.css';

const PanelDeControl = () => {
  const { setAuth } = useContext(AuthContext);
  
  const handleLogout = () => {
    setAuth(null);
  };

  return (
    <div className="panel-container">
      <Logo />
      <main className="main-content">
        <div className="control-panel">
          <h2 className="panel-title">Panel de control</h2>

          <div className="management-options">
            <h3 className="options-title">
              ¿A QUÉ GESTIÓN DESEAS INGRESAR?
            </h3>

            <div className="button-container">
              <Button className="option-button conductor">Conductor</Button>
              <Button className="option-button pasajero">Pasajero</Button>
              <Button className="option-button rutas">Rutas</Button>
              <Button className="option-button incidencias">Incidencias</Button>
              <Button className="option-button asignacion">Asignación</Button>
            </div>
          </div>

          <Button className="logout-button" onClick={handleLogout}>
            CERRAR SESIÓN
          </Button>
        </div>
      </main>
    </div>
  );
};

export default PanelDeControl;
